  openModal = () => this.setState({ isOpen: true });
  closeModal = () => this.setState({ isOpen: false });

  render() {
    return (
      <div>
        <Modal.Dialog>
		  <Modal.Header closeButton>
		    <Modal.Title>Modal title</Modal.Title>
		  </Modal.Header>

		  <Modal.Body>
		    <p>Modal body text goes here.</p>
		  </Modal.Body>

		  <Modal.Footer>
		    <Button variant="secondary">Close</Button>
